import axios from "axios";

const apiKey = "a8ce1029e7856b8a14e6b172318a0f31";

export const pochtaTest = async () => {
  try {
    const { data } = await axios.get("https://api.novaposhta.ua/v2.0/json", {
      data: {
        apiKey: apiKey,
        modelName: "Address",
        calledMethod: "getSettlementAreas",
        methodProperties: {
          Ref: "",
        },
      },
    });
    console.log(data);
    return data
  } catch (error) {
    console.error("Error fetching data:", error);
  }
};
